/// Challenge 6
import React from "react";

const Slot = (props) => {
  //   let x = "🥇";
  //   let y = "🥇";
  //   let z = "🥇";

  let x = props.x;
  let y = props.y;
  let z = props.z;
  if (x === y && y === z) {
    return (
      <>
        <div className="slot-inner">
          <h1>
            {x} {y} {z}
          </h1>
          <h1>This is Matching</h1>
          <hr />
        </div>
      </>
    );
  } else {
    return (
      <>
        <div className="slot-inner">
          <h1>
            {x} {y} {z}
          </h1>
          <h1>This is Not Matching</h1>
          <hr />
        </div>
      </>
    );
  }
};

const SlotMachine = () => {
  return (
    <>
      <h1 className="heading-style">🎰 Slot Machine Game 🎰</h1>
      <Slot x="🥇" y="🥇" z="🥇" />
      <Slot x="🥇" y="🎖️" z="" />
      <Slot x="" y="🥇" z="🎖️" />
      <Slot x="🎖️" y="🥇" z="" />
    </>
  );
};

export default SlotMachine;
